import React, { Component } from 'react'

class SearchForm extends Component {
    render() {
        return (
            <div>
                <div className="row">
                    <div className="col-12">
                        <div className="mb-3">
                            <input type="text" className="form-control" id="firstName" placeholder="Birşeyler yazın..." />
                        </div>
                        <div className="mb-3">
                            <button className="btn btn-primary btn-lg btn-block" type="button">Gif Ara</button>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default SearchForm;
